query LatestGuides($perPage: Int = 10) {
  guides(last: $perPage, where: {orderby: TERM_ORDER}) {
    __typename
    nodes {
      __typename
      ...GuideParts
      posts(last: 1) {
        __typename
        nodes {
          __typename
          id
          dateGmt
        }
      }
    }
  }
}
fragment GuideParts on Guide {
  __typename
  id
  guideId
  link
  count
  description
  shortDescription
  name
  slug
  featuredImage {
    __typename
    ...MediaParts
  }
  socialImage {
    __typename
    ...MediaParts
  }
  socialTitle
  colors
  headerImages {
    __typename
    layer
    size
    image {
      __typename
      ...MediaParts
    }
  }
}
fragment MediaParts on MediaItem {
  __typename
  altText
  caption
  credit
  id
  mediaDetails {
    __typename
    height
    width
  }
  sourceUrl
  title
}

